Build a Rust program that calculates the sum of all even integers between two given numbers. The program should take two integer arguments as input and print the sum as output.

## Solution:
```
fn main() {
    let mut sum = 0;
    for n in 2..10 {
        if n % 2 == 0 {
            sum += n;
        }
    }

    println!("{}", sum);
}
``` 
The program uses a for loop to iterate over the numbers from 2 to 10 (inclusive). For each number, the program checks whether it is even by using the modulo operator (%). If the number is even, it is added to the sum variable. Finally, the program prints the sum
